import React from "react";
function Right(prop){
    const data='hello form '
    return(
        <div className="div-right" style={{gridColumn:prop.column,gridRow:prop.rows}}>
            <div className="cart">
                <h1>{data}</h1>
                <div className="mnue"></div>
                <Button_tow />
                
            </div>
        </div>
    );
}
function Button_tow({closeModle}){
    return(
        <button type="button" className="confirm" onClick={()=>closeModle()}>Confirm Order</button>
    );
}
export {}
export default Right;
